create table store_order_lines (
	store_order_line_id VARCHAR(3),
	store_order_line_order_id VARCHAR(3),
	store_order_line_product_id VARCHAR(2),
	store_order_line_unit_price VARCHAR(7),
	store_order_line_item_qty VARCHAR(2),
	store_order_line_total VARCHAR(6),
	store_order_line_status VARCHAR(7),
	store_order_line_arrival_date VARCHAR(15)
);
